import React, { useEffect, useState } from 'react';
import axios from 'axios'
import { Layout, Row, Col } from 'antd';
import Navbar from '../../component/Navbar/Navbar'
import Footer from '../../component/Footer/Footer'
import Banner from '../../component/Banner/Banner'
import { Button } from 'antd';
import { Link } from 'react-router-dom'
import './Profile.css'
import data from '../../data/data'

const { Content } = Layout;
const contentStyle = {
    paddingTop: '10vh',
    // height: '110%',
    width: '100%',
    // backgroundColor:'#0D0311', 
    // // backgroundColor: 'red',
    // display: 'flex',
    // flexWrap: 'wrap',
    // flexDirection: 'column',
    fontFamily: 'Montserrat',
}

const Profile = () => {
    const users = data.users

    return (
        <Layout className="layout" style={{ height: '100%' }}>
            <Navbar />
            <Content style={contentStyle} >
                <div className='profile-container'>
                    <div className='profile-section'>
                        <div className='img-profile'>
                            <img alt={users[0]._id} src={users[0].image} style={{ width: '230px' }}></img>
                        </div>
                        <div className='info-profile'>
                            <h3>{users[0].name} </h3> <hr></hr>
                            <h4>{users[0].description}</h4> <br></br>
                            <h4>{users[0].hashtag}</h4>
                            <h3>Price rate</h3> <hr></hr>
                            {users[0].pricerate} <br></br>
                            <Button type="primary" style={{marginRight}}>BE MY STANDEE</Button>
                            <Button type="primary">WRITE A REVIEW</Button>
                        </div>
                    </div>
                    <div></div>
                </div>
            </Content>
            <Footer />
        </Layout>
    )
}




export default Profile;
